"use client";
import React, { useLayoutEffect } from "react";
import { useTheme } from '@mui/material/styles';
import * as am5 from "@amcharts/amcharts5";
import * as am5plugins_exporting from "@amcharts/amcharts5/plugins/exporting";
import * as am5xy from "@amcharts/amcharts5/xy";
import am5themes_Animated from "@amcharts/amcharts5/themes/Animated";

const data = [
    { room_type: "Deluxe Suite", checkouts: 75, pictureSettings: { src: "data:image/jpeg;base64," } },
    { room_type: "Standard Room", checkouts: 120, pictureSettings: { src: "data:image/jpeg;base64," } },
    { room_type: "Family Room", checkouts: 95, pictureSettings: { src: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRXjuXs-zak8Z2j0NEwhucBgOshTl82MtCVWA&s" } },
    { room_type: "Single Room", checkouts: 80, pictureSettings: { src: "data:image/jpeg;base64," } },
    { room_type: "Executive Suite", checkouts: 60, pictureSettings: { src: "data:image/jpeg;base64," } },
    { room_type: "Presidential Suite", checkouts: 25, pictureSettings: { src: "data:image/jpeg;base64," } }
];
export default function MovingColumnChart() {
    const theme = useTheme();
    const mode = theme.palette.mode;
    const customColors = theme.palette.customColors;
    useLayoutEffect(() => {
        const MovingColumnRoot = am5.Root.new("movingcolumnchartdiv");
        const colors = am5.ColorSet.new(MovingColumnRoot, { colors: customColors.map(color => am5.color(color)) });
        // Set themes
        MovingColumnRoot.setThemes([am5themes_Animated.new(MovingColumnRoot)]);

        // Create chart
        const chart = MovingColumnRoot.container.children.push(am5xy.XYChart.new(MovingColumnRoot, { panX: false, panY: false, wheelX: "none", wheelY: "none", paddingBottom: 50, paddingTop: 40, paddingLeft: 0, paddingRight: 0 }));

        // Set screen reader text for the chart
        chart.set("ariaLabel", "A Moving Column chart");

        // We don't want zoom-out button to appear while animating, so we hide it
        chart.zoomOutButton.set("forceHidden", true);

        // Create axes
        const xRenderer = am5xy.AxisRendererX.new(MovingColumnRoot, { minorGridEnabled: true, minGridDistance: 30});
        xRenderer.labels.template.setAll({ fill: mode == "light" ? am5.color(0x000000) : am5.color(0xffffff), oversizedBehavior: "wrap", textAlign: "center" });
        xRenderer.grid.template.setAll({"visible": false});

        const xAxis = chart.xAxes.push( am5xy.CategoryAxis.new(MovingColumnRoot, { paddingTop: 40, categoryField: "room_type", renderer: xRenderer }) );
        xAxis.children.unshift(am5.Label.new(MovingColumnRoot, {
            fill: mode == "light" ? am5.color(0x000000) : am5.color(0xffffff),
            text: "Room Type",
            fontSize: 20,
            fontWeight: "500",
            textAlign: "center",
            y: am5.percent(100),
            x: am5.percent(50),
            centerX: am5.percent(50),
            paddingTop: 10,
            paddingBottom: 10
        }));

        const yRenderer = am5xy.AxisRendererY.new(MovingColumnRoot, {});
        yRenderer.grid.template.setAll({"strokeDasharray": [3], stroke: mode == "light" ? am5.color(0x000000) : am5.color(0xffffff)});
        yRenderer.labels.template.setAll({ fill: mode == "light" ? am5.color(0x000000) : am5.color(0xffffff), });

        const yAxis = chart.yAxes.push(
            am5xy.ValueAxis.new(MovingColumnRoot, {
                min: 0,
                renderer: yRenderer
            })
        );
        yAxis.children.unshift(am5.Label.new(MovingColumnRoot, {
            fill: mode == "light" ? am5.color(0x000000) : am5.color(0xffffff),
            text: "Total Check Outs",
            rotation: -90,
            fontSize: 20,
            fontWeight: "500",
            textAlign: "center",
            y: am5.percent(50),
            x: am5.percent(50),
            centerY: am5.percent(50),
            paddingTop: 10,
            paddingBottom: 10
        }));

        // Add series
        const series = chart.series.push(
            am5xy.ColumnSeries.new(MovingColumnRoot, {
                name: "Income",
                xAxis: xAxis,
                yAxis: yAxis,
                valueYField: "checkouts",
                categoryXField: "room_type",
                sequencedInterpolation: true,
                calculateAggregates: true,
                maskBullets: false,
                tooltip: am5.Tooltip.new(MovingColumnRoot, { dy: -30, pointerOrientation: "vertical", labelText: "{valueY}" })
            })
        );

        series.columns.template.setAll({
            strokeOpacity: 0,
            cornerRadiusBR: 10,
            cornerRadiusTR: 10,
            cornerRadiusBL: 10,
            cornerRadiusTL: 10,
            maxWidth: 50,
            fillOpacity: 0.8
        });

        type columnSeriesDataItem = typeof series["dataItem"];
        let currentlyHovered: columnSeriesDataItem | null = null;

        series.columns.template.events.on("pointerover", function (e) { handleHover(e.target.dataItem); });
        series.columns.template.events.on("pointerout", function (e) { handleOut(); });

        function handleHover(dataItem: columnSeriesDataItem) {
            if (dataItem && currentlyHovered != dataItem && dataItem.bullets) {
                handleOut();
                currentlyHovered = dataItem;
                const bullet = dataItem.bullets[0];
                bullet.animate({
                    key: "locationY",
                    to: 1,
                    duration: 600,
                    easing: am5.ease.out(am5.ease.cubic)
                });
            }
        }

        function handleOut() {
            if (currentlyHovered && currentlyHovered.bullets) {
                const bullet = currentlyHovered.bullets[0];
                bullet.animate({
                    key: "locationY",
                    to: 0,
                    duration: 600,
                    easing: am5.ease.out(am5.ease.cubic)
                });
            }
        }

        const circleTemplate: am5.Template<am5.Circle> = am5.Template.new({});
        series.bullets.push(function (root, series, dataItem) {
            const bulletContainer = am5.Container.new(root, {});
            const circle = bulletContainer.children.push(am5.Circle.new(root, { radius: 34 }, circleTemplate));
            const maskCircle = bulletContainer.children.push(am5.Circle.new(root, { radius: 27 }));

            // only containers can be masked, so we add image to another container
            const imageContainer = bulletContainer.children.push(
                am5.Container.new(root, {mask: maskCircle}));

            const image = imageContainer.children.push(
                am5.Picture.new(root, {
                    templateField: "pictureSettings",
                    centerX: am5.p50,
                    centerY: am5.p50,
                    width: 60,
                    height: 60
                })
            );

            return am5.Bullet.new(root, {
                locationY: 0,
                sprite: bulletContainer
            });
        });
        // heatrule
        series.set("heatRules", [
            { dataField: "valueY", min: colors.getIndex(1), max: colors.getIndex(7), target: series.columns.template, key: "fill" },
            { dataField: "valueY", min: colors.getIndex(1), max: colors.getIndex(7), target: circleTemplate, key: "fill" }
        ]);

        series.data.setAll(data);
        xAxis.data.setAll(data);

        // Make stuff animate on load
        series.appear();
        chart.appear(1000, 100);

        //Exporting
        const exporting = am5plugins_exporting.Exporting.new(MovingColumnRoot, {
            menu: am5plugins_exporting.ExportingMenu.new(MovingColumnRoot, {}),
            filePrefix: "Moving_Column_Chart",
            //title: "Total Response by Country",
            pngOptions: { minWidth: 1000, maxWidth: 2000, minHeight: 1000, maxHeight: 5000 },
            jpgOptions: { minWidth: 1000, maxWidth: 2000, minHeight: 1000, maxHeight: 5000 },
            pdfOptions: { pageSize: "A4", pageOrientation: "landscape", pageMargins: [30, 30, 30, 30], addURL: false }
        });

        exporting.events.on("exportstarted", function () { });
        exporting.events.on("exportfinished", function () { });

        return () => MovingColumnRoot && MovingColumnRoot.dispose();
    }, [mode, customColors]);

    return ( <div id="movingcolumnchartdiv" style={{ width: "100%", height: "650px" }}></div>);
};